import { Container, Typography } from "@mui/material";

const Services = () => {
  return (
    <Container sx={{ py: 2 }}>
      <Typography
        variant="h3"
        sx={{
          textAlign: "center",
          color: "#000032",
          mb: 2
        }}
      >
        Services     
        </Typography>
    </Container>
  );
};

export default Services;
